data Input = Input Prog [String]
    deriving (Eq, Show)

data Prog = Prog String Int
    deriving (Eq, Show, Ord)

data Tower a = Node Prog [Tower a] | Leaf Prog
    deriving (Show)
makeBaseFunctor ''Tower

testTower = Node (Prog "" 10) [Leaf (Prog "" 4)]

part1 :: Result String
part1 = head <$> diff
    where
        diff = (\\) <$> allInputs <*> bottoms
        bottoms = nub . concatMap (\(Input _ xs) -> xs) <$> inp
        allInputs = map (\(Input (Prog x _) _) -> x) <$> inp
        inp = parseInput input
       
mkMap :: [Input] -> Map Prog [String]
mkMap = foldl' (\m (Input p ss) -> M.insertWith (++) p ss m) M.empty 

mkTower :: Map Prog [String] -> TowerF a a
mkTower m = LeafF (Prog "" 1)

sumOfChildrenAlg :: TowerF a [(Prog,Int)]-> [(Prog,Int)]
sumOfChildrenAlg (NodeF p@(Prog _ r) f) = (p, r + sum (map snd (concat f))):concat f
sumOfChildrenAlg (LeafF p@(Prog _ r)) = [(p, r)]
        
parseInput :: String -> Result [Input]
parseInput = parseString (some (inputParser <* skipOptional newline)) mempty

inputParser :: Parser Input
inputParser = Input <$> progParser <*> onTopParser
    where
        progParser = Prog <$> token (many letter) <*> token weightParser
        onTopParser = fromMaybe [] <$> optional (token (string "->") *> commaSep (many letter))
        weightParser = read <$> parens (some digit)


